angular.module('phoenix').config(function($stateProvider, $urlRouterProvider, $locationProvider) {
    // For any unmatched url, redirect to homepage /
    var defaultPage = 'kitchen-sink';

    $locationProvider.html5Mode(false);

    // 404 redirects
    $urlRouterProvider.otherwise(defaultPage);

    // Default views
    $stateProvider.state('page', {
            url: '/{slug}',
            templateUrl: function (params) {
                // remove .html if it is there
                params.slug = params.slug.replace('.html', '');

                if (params.slug === '') {
                    params.slug = defaultPage;
                }

                return 'demo/' + params.slug + '.html';
            }
        })
});

